import React from "react";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import {
  faHouseChimneyWindow,
  faAddressCard,
  faRectangleList,
  faEnvelope,
} from "@fortawesome/free-solid-svg-icons";

const MobileNavBar = () => {
  return (
    <>
      <nav className="mobile-nav not-fancy-font">
        <div className="bloc-icon flex flex-col">
          <FontAwesomeIcon icon={faAddressCard} className="text-30 text-dark-gray" />
          <div>About</div>
        </div>
        <div className="bloc-icon flex flex-col">
          <FontAwesomeIcon icon={faHouseChimneyWindow} className="text-30 text-dark-gray" />
          <div>Home</div>
        </div>
        <div className="bloc-icon  flex flex-col">
          <FontAwesomeIcon icon={faRectangleList} className="text-30 text-dark-gray" />
          <div>Projects</div>
        </div>
        <div className="bloc-icon flex flex-col">
          <FontAwesomeIcon icon={faEnvelope} className="text-30 text-dark-gray" />
          <div>Contact</div>
        </div>
      </nav>
    </>
  );
};

export default MobileNavBar;
